import React from "react";
import styles from "../styles/ProjectLists.module.css";

export default function ProjectLists() {
  return (
    <div style={{ marginTop: "100px" }}>
      <div className={styles.flexCol1}></div>
      <div className={styles.flexCol2}></div>
      <div className={styles.flexCol1}></div>
    </div>
  );
}
